import React from 'react';
import h from './Header.module.css';


const Header = () => {
    return (
        <header className={h.header}>
            <img src="https://previews.123rf.com/images/ppbig/ppbig1805/ppbig180501422/106633535-social-network-global-communication-network-connecting-people.jpg" />
        </header>
    );
}

export default Header;
